import React from 'react';

function Register() {
    return (
        <div>
            <h1>Register Page</h1>
            <form>
                <input type="text" id="username" placeholder="Username"></input>
                <input type="text" id="password" placeholder="Password"></input>
                <button id = "register-button">Register</button>
            </form>
        </div>
    );
}

export default Register;
